import React from "react";
import { connect } from "react-redux";
import { createStructuredSelector } from "reselect";

import CheckoutItem from "../../components/checkout-item/checkout-item.component";
import StripeCheckoutButton from "../../components/stripe-button/stripe-button.component";
import SubmitButton from "../../components/payment-button/submit-button.styles";
import BillingDetailsFields from "./billing-credentials-fields";

import {
  selectCartItems,
  selectCartTotal,
} from "../../redux/cart/cart.selectors";

import "./checkout.styles.scss";

const CheckoutPage = ({ cartItems, total }) => (
  <div class="some-page-wrapper">
    <div class="row">
      <div className="double-column">
        <div class="column">
          <div class="blue-column">Some Text in Column One</div>
        </div>
      </div>
      <div class="column">
        <div class="green-column">Some Text in Column Two</div>
      </div>
    </div>
  </div>
);

const mapStateToProps = createStructuredSelector({
  cartItems: selectCartItems,
  total: selectCartTotal,
});

export default connect(mapStateToProps)(CheckoutPage);
